import React from 'react';
import '../App/App.css';
import { BrowserRouter, Route, Switch} from 'react-router-dom';
import Authentication from '../Authentication/Authentication';
import Dashboard from '../Dashboard/Dashboard';
import {AboutUs, OurAim, OurVision} from '../../Pages/About/AboutUs';
import {Services, ServiceOne, ServiceTwo, ServiceThree} from '../../Pages/Services/Services';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path='/' exact component={Authentication} />
          <Route path='/dashboard' exact component={Dashboard} />
          <Route path='/about-us' exact component={AboutUs} />
          <Route path='/about-us/aim' exact component={OurAim} />
          <Route path='/about-us/vision' exact component={OurVision} />
          <Route path='/services' exact component={Services} />
          <Route path='/services/service 1' exact component={Services} />
          <Route path='/services/service 2' exact component={ServiceT} />
          <Route path='/services/service 3' exact component={Services} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
